css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("debianforum.ru") {
body {
  background: #4C5568 url(data:image/png;base64,)!important;
  font-family: Verdana, Arial, Tahoma, Helvetica, Sans-serif!important;
}
body.rich_editor {
  background: #FFF!important;
  padding: 4px!important;
}
a:link, a:visited {
  text-decoration: underline!important;
}
.bbc_link:link, .bbc_link:visited {
  color: #343D65!important;
}
a:hover, .bbc_link:hover {
  color: #bc0a40!important;
}
th.last_th {
  min-width: 260px;
}
#header {
  background: transparent center top no-repeat url(http://storage6.static.itmages.ru/i/13/0222/h_1361530112_3894655_2f0f8279b7.png)!important;
  position: static!important;
  height: 114px!important;
}
#header a[href$='index.php'] {
  background: transparent left top no-repeat url(data:image/png;base64,)!important;
  width: 341px!important;
  height: 125px!important;
  top: 23px!important;
  position: absolute;
  z-index: 20;
  left: 50px;
  outline: 0 none;
}
#header a[href$='index.php'] span {
  display: none!important;
}
#header a[href$='index.php']:active {
  top: 24px!important;
}
.navigate_section {
  font-size: 14px;
}
#toolbar {
  position: relative;
  background: transparent left top repeat-x url(data:image/png;base64,)!important;
  height: 54px!important;
  border: 0 none!important;
}
ul#topnav {
  padding: 6px 0!important;
  position: absolute;
  z-index: 21;
  margin-left: 114px!important;
}
ul#topnav li {
  margin-right: 2px!important;
}
ul#topnav li a, #search_float a {
  line-height: 34px!important;
  border-radius: 4px;
  background: transparent!important;
  font-size: 12px;
  font-weight: bold;
  color: #ecedef!important;
  text-decoration: none;
  padding: 0 15px;
  margin: 4px 0;
  text-decoration: none!important;
  outline: 0 none;
}
ul#topnav li a:active {
  position: relative;
  top: 1px;
}
ul#topnav li a:hover,#topnav li a.active,#search_float a:hover  {
  background: rgba(0,0,0,0.2)!important;
  color: #899fb4!important;
}
#topnav li ul {
  margin-top: 11px!important;
  margin-left: 2px!important;
  padding: 1px!important;
  background: #fff!important;
  border: 0!important;
  box-shadow: rgba(0,0,0,0.3) 0 2px 4px;
}
#topnav li#button_home {
  display: none;
}
#topnav li ul a{
  color: #343d65!important;
  border-radius: 0;
  margin: 0!important;
}
#topnav li ul a:hover{
  background: #6679b1!important;
  color: #fff!important;
}
#userinfo {
  padding: 25px 50px 25px 0!important;
  color: #d1d2d7!important;
}
#userinfo a {
  text-decoration: underline!important;
}
#userinfo a:hover {
  color: #fff!important;
}
#search_float {
  display: block;
  position: absolute!important;
  z-index: 22!important;
  right: 50px!important;
  top: -48px!important;
}
#search_float a:hover {
  color: #ecedef!important;
}
#search_float a img {
  padding-left:16px!important;
  width:0!important;
  height: 16px;
  background: transparent left center no-repeat url(data:image/png;base64,)!important;
  vertical-align: middle;
}
#search_float a:after {
  content: "Поиск";
}
img[src$='/images/off.png'],img[src$='/images/on.png'], img[src$='/images/on2.png'],img[src$='/images/new_some.png'],img[src$='/images/new_none.png'],img[src$='images/collapse.gif'],img[src$='images/expand.gif'] {
  background-image:url(data:image/png;base64,)!important;
}
img[src$='/images/off.png'] {
  height:44px!important;
  padding-left:36px!important;
  width:0!important;
  background-repeat: no-repeat;
  background-position: -36px 0;
}
img[src$='/images/on.png'], img[src$='/images/on2.png'] {
  height:44px!important;
  padding-left:36px!important;
  width:0!important;
  background-repeat: no-repeat;
  background-position: 0 0;
}
img[src$='/images/new_some.png'] {
  height:32px!important;
  padding-left:26px!important;
  width:0!important;
  background-repeat: no-repeat;
  background-position: 0 -44px;
}
img[src$='/images/new_none.png'] {
  height:32px!important;
  padding-left:26px!important;
  width:0!important;
  background-repeat: no-repeat;
  background-position: -26px -44px;
}
img[src$='images/collapse.gif'] {
  height:13px!important;
  padding-left:13px!important;
  width:0!important;
  background-repeat: no-repeat;
  background-position: -52px -57px;
}
img[src$='images/expand.gif'] {
  height:13px!important;
  padding-left:13px!important;
  width:0!important;
  background-repeat: no-repeat;
  background-position: -52px -44px;
}
#mainarea {
  padding: 0 0px 10px!important;
  position: relative;
  background: transparent!important;
  border: 0 none!important;
}
.navigate_section {
  padding: 0px 50px 6px 50px!important;
  color: #b0b6ca!important;
}
.navigate_section a {
  color: #b0b6ca!important;
  text-decoration: none!important;
}
.navigate_section a:hover {
  text-decoration: underline!important;
}
.message-container {
  padding: 0!important;
}
.ui-corner-all, .ui-corner-bottom, .ui-corner-right, .ui-corner-br {
  border-radius: 0!important;
}
#messageBoxSmfSimple,#recent .cat_bar, #admin_menu {
  background: no-repeat scroll 50% top #f2f2f2 url(data:image/png;base64,)!important;
  border: 1px solid #f2f2f2!important;
}
#messageBoxSmfSimple {
  border-bottom: #dfdfdf 1px solid!important;
}
#pollmoderation, #moderationbuttons {
  background: #f2f2f2!important;
  padding: 4px 40px 8px 40px!important;
  border-bottom: #dadada 1px solid!important;
}
.ui-state-highlight, .ui-widget-content .ui-state-highlight, .ui-widget-header .ui-state-highlight {
  background: transparent!important;
  border: 0!important;
}
#admin_menu, #adm_submenus {
  padding: 10px 40px 4px 40px!important;
}
p.description, #moderationbuttons ul, #display_jump_to,.message-container p,.flow_hidden .windowbg, .flow_hidden .windowbg2, .core_posts,div.table_frame .table_list, .childboards, .table_grid,.buttonlist ul,#statistics div.title_bar, .ThankOMatic {
  margin: 0!important;
}
#messageBoxSmfSimple a.bbc_link:link {
  color: #343d65!important;
  padding: 0 10px 0 0px!important;
  line-height: 48px!important;
  display: inline-block;
  outline: 0 none;
}
#messageBoxSmfSimple a.bbc_link:visited {
  color: #343d65!important;
}
#messageBoxSmfSimple a.bbc_link:before {
  content: "";
  vertical-align: middle;
  width: 24px;
  height: 24px;
  background-position: 0 center;
  background-repeat: no-repeat;
  background-color: transparent;
  display: inline-block;
  background-image: url(data:image/png;base64,)!important;
  margin-right: 4px;
}
#messageBoxSmfSimple a.bbc_link:hover {
  color: #bc0a40!important;
}
#messageBoxSmfSimple a.bbc_link[href$='/intro/about']:before {
  background-position: 0 0;
}
#messageBoxSmfSimple a.bbc_link[href$='/distrib/']:before {
  background-position: -24px 0;
}
#messageBoxSmfSimple a.bbc_link[href$='/support#web']:before {
  background-position: -48px 0;
}
#messageBoxSmfSimple a.bbc_link[href$='/devel/']:before {
  background-position: 0 -24px;
}
#messageBoxSmfSimple a.bbc_link[href$='/ru/FrontPage']:before {
  background-position: -24px -24px;
}
#messageBoxSmfSimple a.bbc_link[href$='/index.php?topic=1207.0']:before {
  background-position: -48px -24px;
}
#messageBoxSmfSimple .ui-widget p span, .board_rules {
  display: none!important;
}
.pagesection, td.smalltext, #whoisviewing {
  background: #fff;
  padding: 4px 50px!important;
  margin: 0!important;
  border-bottom: #dadada 1px solid!important;
}
#postmodify .roundframe {
  padding: 0 50px!important;
}
#admin_content {
  padding: 0!important;
}
#admin_content .windowbg2, .ThankOMatic {
  padding: 0 20px!important;
}
#whoisviewing {
  border-bottom: #dadada 1px solid!important;
}
table.table_list, table.table_grid {
  border-collapse: collapse!important;
}
div.cat_bar {
  padding: 0 50px!important;
}
div.cat_bar, .catbg, .catbg2, tr.catbg td, tr.catbg2 td, tr.catbg th, tr.catbg2 th {
  background: #484f6a left bottom repeat-x url(data:image/png;base64,)!important;
  margin: 0!important;
}
h4.catbg, h4.catbg2, h3.catbg, h3.catbg2, .table_list tbody.header td.catbg {
  background: transparent!important;
  padding: 0!important;
  color: #dbe0f5!important;
}
h3.catbg a:link, h3.catbg a:visited, h4.catbg a:link, h4.catbg a:visited, h3.catbg, .table_list tbody.header td, .table_list tbody.header td a {
  color: #dbe0f5!important;
  text-decoration: none!important;
}
h3.catbg a:hover, h4.catbg a:hover, .table_list tbody.header td a:hover {
  text-decoration: underline!important;
}
#recent .cat_bar h3, #recent .cat_bar h3 a {
  color: #343d65!important;
  font-size: 12px!important;
}
#recent .cat_bar h3 a {
  text-decoration: underline!important;
}
#recent .cat_bar {
  border-bottom: #dadada 1px solid!important;
}
#recent .cat_bar h3 a:hover {
  color: #bc0a40!important;
}
tbody.divider {
  display: none;
}
td.icon {
  padding-left: 50px!important;
  background: transparent!important;
}
td.icon1 {
  padding-left: 50px!important;
}
td.lastpost {
  padding-right: 50px!important;
}
table.table_list tr.windowbg2 {
  border-top: #dadada 1px solid!important;
}
table.table_list tr.windowbg2, table.table_list td.children, table.table_list .windowbg, table.table_grid td {
  background: #f2f2f2!important;
}
.table_frame .table_list td.icon, .table_frame .table_list td.info, .table_frame .table_list td.stats {
  border: 0!important;
}
.post_wrapper, .core_posts, .flow_hidden .windowbg, .flow_hidden .windowbg2 {
  padding: 0 40px;
  width: auto!important;
  float: none!important;
}
span.botslice, span.topslice, span.topslice span, span.botslice span {
  background: transparent!important;
  margin:0!important;
  height:0!important;
}
table.table_grid td {
  border: 0!important;
  border-bottom: #dadada 1px solid!important;
}
table.table_grid tr:nth-child(odd) td {
  background: #fff!important;
}
table.table_grid td.stickybg, table.table_grid td.stickybg2 {
  background: #e0e0e0!important;
}
table.table_grid td.lockedbg, table.table_grid td.lockedbg2, table.table_grid td.lockedbg a:link, table.table_grid td.lockedbg2 a:link {
  color: #757575!important;
}
.mark_read .buttonlist {
  margin-top: -40px!important;
  padding-right: 40px!important;
}
#posting_icons {
  background: #f2f2f2!important;
  width: 100%;
  padding: 15px 0!important;
  margin: 0!important;
}
#posting_icons ul {
  margin-left: 40px!important;
}
#posting_icons ul li:last-child, .nextlinks_bottom, .nextlinks {
  display: none!important;
}
span.upperframe, span.lowerframe {
  padding: 0!important;
}
span.upperframe span, span.lowerframe span {
  height: 0!important;
}
.roundframe, .description, .description_board, .plainbox {
  background: #e1e1e1!important;
  border: 0!important;
  padding: 0!important;
  color: #343d65!important;
}
.description, .description_board, .plainbox, #postmodify {
  padding: 10px 50px!important;
}
#upshrinkHeaderIC, #topic_icons {
  margin: 0!important;
  font-size: 11px;
  border-bottom: #fff 1px solid;
}
#upshrinkHeaderIC p {
  margin: 0!important;
  padding: 12px 40px!important;
}
#upshrinkHeaderIC p a {
  text-decoration: underline!important;
}
#upshrinkHeaderIC p a:hover {
  color: #bc0a40!important;
}
div.title_barIC {
  background: #a6abba center top no-repeat url(data:image/png;base64,)!important;
  border: #a6abba 1px solid;
  margin: 0!important;
  padding: 0 40px!important;
}
div.title_barIC h4.titlebg {
  background: transparent!important;
}
#footer {
  margin: 0 40px;
  background: no-repeat scroll 0 center transparent url(data:image/png;base64,)!important;
  padding: 20px 0 30px 0!important;
}
.buttonlist ul li a, .dropmenu li a.firstlevel {
  text-transform: none!important;
  text-decoration: none!important;
  font-weight: normal!important;
  font-size: 10px!important;
  border: #bbb 1px solid;
  text-shadow: 0 1px 1px #FFFFFF;
  border-radius: 4px;
  background-position: 0 -60px!important;
}
.buttonlist ul li a.active, #admin_menu ul li a.firstlevel.active {
  background-position: 0 -30px!important;
}

.buttonlist ul li a:hover, #admin_menu ul li a.firstlevel:hover {
  background-position: 0 -1px!important;
}
.buttonlist ul li a, .dropmenu li a.firstlevel {
  background-image: url(data:image/png;base64,)!important;
  background-repeat: repeat-x!important;
  padding-right: 8px!important;
}
.dropmenu li a.firstlevel {
  padding-left: 8px!important;
  color: #222!important;
}
.buttonlist ul li a.active, #admin_menu ul li a.firstlevel.active, .buttonlist ul li a:hover, #admin_menu ul li a.firstlevel:hover {
  border-color: rgba(0, 0, 0, 0.1)!important;
  text-shadow: 0 -1px 0px rgba(0, 0, 0, 0.2);
  color: #fff!important;
}
.buttonlist ul li a span, .dropmenu li a.firstlevel span {
  background: transparent!important;
  line-height: 18px!important;
  height: 18px!important;
}
.buttonlist ul li a:hover, .dropmenu li a.firstlevel:hover {
  color: #fff!important;
  background-position: 0 -1px!important;
}
#statistics, #calendar, #calendar th, #profileview {
  background-color: #E0E0E0;
}
.poster_thank {
  padding: 6px 40px!important;
  font-size: 11px!important;
  min-height: 30px!important;
}
.poster {
  width: 13em!important;
}
.postarea, .moderatorbar {
  margin: 0 0 0 13em!important;
}
div.windowbg,div.windowbg2 {
  padding: 10px 0!important;
  border-bottom: 1px solid #DADADA !important;
}
code.bbc_code {
  background: none repeat scroll 0 0 #FFFFFF !important;
  border-bottom: 2px solid #DEDEDE !important;
  border-top: 2px solid #DEDEDE !important;
  display: block !important;
  font-family: "dejavu sans mono","monaco","lucida console","courier new",monospace !important;
  font-size: 12px !important;
  line-height: 1.5em !important;
  margin: 6px 8px 10px 0 !important;
  padding: 8px 1em !important;
  white-space: pre !important;
  overflow: auto !important;
  height: auto !important;
}

#adm_submenus,#admin_content .pagelinks,#admin_content table.bordercolor{
  background: #fff;
  padding: 4px 50px!important;
  margin: 0!important;
}
}
